import React from 'react';
import { render } from 'react-dom';
import './index.scss';
import App from './App';
import { UserProvider  } from './contexts/user.contexts';

import { BrowserRouter } from 'react-router-dom';

const rootElement = document.getElementById('root');

render(
  <React.StrictMode>
    <BrowserRouter>
    <UserProvider>
      <App />
      </UserProvider>
    </BrowserRouter>
  </React.StrictMode>,
  rootElement
);
